import React, { useEffect, useState } from "react";
import {  Switch, Link, NavLink } from "react-router-dom";
import AddOrgaanization from './AddOrganization';
import OrganizationList from "./OrganizationList";
import { Route } from "react-router";
import { BrowserRouter } from "react-router-dom";


function Services(props){

    async function getOrganizations(){
        let result = await fetch("https://localhost:44312/api/Organization",{
            method: 'GET',
            headers: {
                "Content-Type": "application/json",
                "Accept": "application/json",
                "Authorization": "Bearer "+ localStorage.getItem("tok"),
            },
        });
        console.log(result.status);
        result = await result.json();
        localStorage.setItem("org", JSON.stringify(result));
        console.log(localStorage.getItem("org"));
    
    }
    
    
    
    
    
    
    return (
        <BrowserRouter>
            <div className="container">
                <nav className="btn btn-warning navbar navbar-expand-lg navhead">
                    <div className="collapse navbar-callapse">
                        <ul className="navbar-nav mr-auto">
                            <li className="nav-item">
                                {/* <NavLink>dsads</NavLink> */}
                                <Link to={'./AddOrganization'} className="nav-link">Add New Organization</Link>
                            </li>
                            <li className="nav-item">
                                <Link to={'./OrganizationList'} className="nav-link">Organization List</Link>
                            </li>
                        </ul>
                    </div>
                </nav>
                <br></br>
                <Switch>
                    <Route exact path="./AddOrgaanization" component={AddOrgaanization}/>
                    <Route path="./OrganizationList" component={OrganizationList}/>

                </Switch>
            </div>
        </BrowserRouter>
    
    )


}

export default  Services;
